import axios from 'axios';
import Link from 'next/Link'

 function listwords({ words }) {

   console.log(words.tempDoc)

    return (
        <div>
        {words.tempDoc.map(function(item, i){
             return  <Link href="/definitions/[word].js">{item.word}</Link>
            })}
      </div>
      )
}

export async function getServerSideProps() {

   const wordlist = await axios.get(`http://localhost:5050/api/words`)

    return {
      props: {
       words: wordlist.data
      }
    }
  }


export default listwords
